import React, { Component } from 'react';
import {
    Link
} from "react-router-dom";
import News from '../Componant/News'

class Actualite extends Component {
    constructor(props) {
        super(props);
        this.state = {
            title: '',
            items: [],
            content_title: [],
            content_description: [],
        }


    }
    render() {
        return (
            <div className="containerNews">
                Actualite
                <Link to="/Home">Home</Link>
                <div className="containerNews">

                </div>
            </div>

        );
    }
}

export default Actualite;
